// ==UserScript==
// @name         토끼 캡챠 해제 스크립트
// @description  마나토끼,뉴토끼,북토끼 캡챠 해제(애드가드, 템퍼몽키, ios userscripts앱)
// @version      1.3.11
// @match        *://*/*
// @connect      cdn.jsdelivr.net
// @grant        GM.getValue
// @grant        GM.setValue
// @require      https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@4.17.0/dist/tf.min.js
// @inject-into  content
// @run-at       document-start
// ==/UserScript==

(async function () {
    const url = window.location.hostname;
    const filePath = window.location.pathname;
    if ((url.includes("newtoki")) || (url.includes("manatoki")) || (url.includes("booktoki"))) {
        if (filePath.includes("captcha_check")) {
            document.open();
            document.write('<script>document.location.replace("' + document.referrer + '");<\/script>');
            document.close();
        }
        const cookieName = "PHPSESSID";
        const expirationMinutes = 25;
        // Helper to get a cookie value by name
        function getCookie(name) {
            const cookies = document.cookie.split("; ");
            for (const cookie of cookies) {
                const [key, value] = cookie.split("=");
                if (key === name) return decodeURIComponent(value);
            }
            return undefined; // 쿠키가 없으면 undefined 반환
        }

        // Helper to set a cookie
        function setCookie(name, value, minutes) {
            const expirationDate = new Date();
            expirationDate.setTime(expirationDate.getTime() + minutes * 60 * 1000);
            document.cookie = `${name}=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/; SameSite=None; Secure`;
            document.cookie = `${name}=${value}; expires=${expirationDate.toUTCString()}; path=/; SameSite=None; Secure`;
        }

        // Helper to check if a stored PHPSESSID is expired
        async function isStoredCookieExpired() {
            const storedTimestamp = await GM.getValue(`${cookieName}_timestamp`, null);
            if (!storedTimestamp) return true; // 저장된 타임스탬프가 없으면 만료된 것으로 간주
            const now = new Date().getTime();
            return (now - parseInt(storedTimestamp, 10)) > expirationMinutes * 60 * 1000;
        }

        // Check if PHPSESSID is valid
        if (await isStoredCookieExpired()) {
            console.log("PHPSESSID가 만료되었거나 저장된 값이 없습니다. 현재 쿠키를 저장합니다.");

            const currentCookieValue = getCookie(cookieName);
            if (currentCookieValue) {
                // Save to GM storage and set it as a cookie
                await GM.setValue(`${cookieName}_value`, currentCookieValue);
                await GM.setValue(`${cookieName}_timestamp`, new Date().getTime());
                setCookie(cookieName, currentCookieValue, expirationMinutes);
                console.log(`PHPSESSID 갱신 및 저장: ${currentCookieValue}`);
            } else {
                console.warn("현재 PHPSESSID 쿠키를 찾을 수 없습니다.");
            }
        } else {
            console.log("PHPSESSID가 유효합니다. 저장된 값을 사용합니다.");

            const storedValue = await GM.getValue(`${cookieName}_value`, null);
            if (storedValue) {
                setCookie(cookieName, storedValue, expirationMinutes);
                console.log(`저장된 PHPSESSID 쿠키 재설정: ${storedValue}`);
            } else {
                console.warn("저장된 PHPSESSID 값을 찾을 수 없습니다.");
            }
        }

        if (filePath.includes("bbs/captcha") || /^\/monster(\/|$)/.test(filePath)) {
            var tf = window.tf;
            tf.setBackend('cpu').then(() => {
                const interval = setInterval(() => {
                    const captchaImgElement = document.querySelector(".captcha_img");
                    if (captchaImgElement && captchaImgElement.complete && captchaImgElement.naturalHeight > 59) {
                        clearInterval(interval); // Stop checking once the image is fully loaded
                        capcha_processing(captchaImgElement);
                    }
                }, 100); // Check every 100ms
            });
        }
    }

    async function capcha_processing(captchaImgElement) {
        const canvas = document.createElement("canvas");
        canvas.width = captchaImgElement.naturalWidth;
        canvas.height = captchaImgElement.naturalHeight;

        // 캔버스에 이미지 복사
        const context = canvas.getContext("2d");
        context.drawImage(captchaImgElement, 0, 0);

        // 캔버스의 픽셀 데이터를 TensorFlow로 직접 전달
        const finalImage = await image_preprocessing(canvas);
        const modelJsonBlob = new Blob([base64ToArrayBuffer(modelJsonBase64)], { type: 'application/json' });
        const modelBinBlob = new Blob([base64ToArrayBuffer(modelBinBase64)], { type: 'application/octet-stream' });

        const modelJsonUrl = URL.createObjectURL(modelJsonBlob);
        const modelBinUrl = URL.createObjectURL(modelBinBlob);

        try {
            const model = await tf.loadGraphModel(tf.io.browserHTTPRequest(modelJsonUrl, {
                fetchFunc: (url) => {
                    return url.endsWith(".bin") ? fetch(modelBinUrl) : fetch(url);
                }
            }));

            const prediction = await model.executeAsync(finalImage);
            const value = prediction.dataSync();
            const captcha_number = ctc_greedy_decoder(value);
            document.getElementById("captcha_key").value = captcha_number;
            document.getElementsByName("fcaptcha")[0].submit();

        } catch (error) {
            console.log("Model load or executeAsync failed: " + (error.message || "No error message") + "\nStack Trace: " + (error.stack || "No stack trace"));
        } finally {
            URL.revokeObjectURL(modelJsonUrl);
            URL.revokeObjectURL(modelBinUrl);
        }
    }

    function image_preprocessing(canvas) {
        let image = tf.browser.fromPixels(canvas, 1); // canvas의 픽셀 데이터를 읽어옴
        image = tf.image.resizeBilinear(image, [50, 200]).div(tf.scalar(255)).toFloat();
        image = tf.transpose(image, [1, 0, 2]);
        image = tf.expandDims(image, 0);
        return image;
    }

    function base64ToArrayBuffer(base64) {
        const binaryString = atob(base64);
        const len = binaryString.length;
        const bytes = new Uint8Array(len);
        for (let i = 0; i < len; i++) {
            bytes[i] = binaryString.charCodeAt(i);
        }
        return bytes.buffer;
    }

    function ctc_greedy_decoder(value) {
        let index = 0;
        let list = [];
        let maxnumindex = 0;
        let maxnum = 0;
        for (const element of value) {
            if (index === 0) {
                maxnum = element;
                maxnumindex = 0;
            }
            if (maxnum < element) {
                maxnum = element;
                maxnumindex = index;
            }
            if (index === 10) {
                list.push(maxnumindex);
                index = 0;
                maxnumindex = 0;
            } else {
                index++;
            }
        }
        let list2 = [];
        for (let i = 0; i < 49; i++) {
            if (list[i] !== list[i + 1]) {
                list2.push(list[i]);
            }
        }
        list2.push(list[list.length - 1]);
        const strNum = list2.join('');
        return strNum.replace(/10/g, '');
    }

    // Base64로 인코딩된 모델 데이터
    const modelJsonBase64 = '';  // model.json의 Base64 인코딩 문자열
    const modelBinBase64 = '';  // group1-shard1of1.bin의 Base64 인코딩 문자열
})();
